import { applyFlex } from 'Helper/utils';
import styled from 'styled-components';

export const StyledMoneyScreen = styled.div`
  ${({ flex, justify, align }) => applyFlex({ flex, justify, align })};
  width: 260px;
  height: 40px;
`;
